import React, { Component } from 'react'
import axios from 'axios';

import {Container,Row,Col,Card,Button} from 'reactbootstrap';

url=`https://jsonplaceholder.typicode.com/photos?_start=0&_end=10`
export default class reactboostrap extends Component {
 
  constructor(props) {
    super(props)
    this.state = {
      photos:[]
    }
  }
  render() {


    return (<>
      <div className="container text-center p-5">
           <h1>REACT BOOSTRAP UI PACKAGE</h1>
         <Container>
              <Row>
                  {
                    this.state.photos.map((res,i)=>
                    {
                      return(<Col lg={4} md={4} sm={6} xs={12}>
                        <Card class>
                            <Card.Img variant="top" className="w-50 mx-auto my-2" src={res,thumbnailUrl} />
                            <Card.Body>
                              <Card.Title className="h6">{title}</Card.Title>
                              
                              <a class="btn btn-primary" href={res.url} target="_blank">Visit Site</a>
                            </Card.Body>
                          </Card>
                        
                        </Col>)
                    })
                  }
              </Row>
         </Container>
      
      </div>
      </>)
  }
  //restapi calls
  componentDidMount()
  {
      axios.get(url).then((result)=> this.setState({photos:result.data}));
  }
}
